import React from "react";

function ContactCont() {
  return (
    <section className="contact__cont">
      <div className="container">
        <div className="contact__inner">
          <div className="text">
            <div>I am</div>  
            <div>a ready</div>
            <div>new frontend.</div>
          </div>
          <p className="desc">
          어떤 일이라도노력하고 즐기면 그 결과는 빛을 바란다고 생각합니다.
          신입의 열정과 도전정신을 깊숙히 새기며 배움에 있어 겸손함을 유지하며
          세부적인 곳까지 파고드는 개발자가 되겠습니다.
          </p>
        </div>
      </div>
    </section>
  );
}

export default ContactCont;
